import { useEffect } from "react";
import { useParams } from "react-router-dom";

function Detail() {
  const { id } = useParams();
  //   console.log(id);
  const getMovie = async () => {
    const json = await await fetch(
      `movie/api/v2/moive_details.json?movie_id=${id}`
    );
    console.log(json.body);
  };
  useEffect(() => {
    getMovie();
  }, []);
  return <h1>Detail</h1>;
}

export default Detail;
